import { QuestionNavbar } from "../QuestionNavbar.js";
import { Info } from "./components/Info.js";

export const Info31 = () => {
  return (
    <div className="infos">
      <QuestionNavbar />
      <Info
        title={[
          "Suomessa sananvapaus on turvattu perustuslaissa sekä Euroopan ihmisoikeussopimuksessa. YK:n​ Ihmisoikeuksien yleismaailmallisen julistuksen 19. artiklan mukaan jokaisella on oikeus mielipiteen- ja sananvapauteen, johon sisältyy oikeus häiritsemättä pitää mielipiteensä sekä oikeus rajoista riippumatta hankkia, vastaanottaa ja levittää tietoja tiedotusvälineiden kautta.",
          "Sananvapauden puolustaminen kuuluu journalismin yhteiskunnallisiin tehtäviin.",
          "Oletko sinä sananvapauden puolustaja? Kenen sananvapautta haluat puolustaa? Miten sananvapaus ja vastuu suhtautuvat toisiinsa?​",
        ]}
        options={[
          {
            value:
              "Sananvapaus ja - vastuu: Journalistiliitto​​",
            navigate: "https://journalistiliitto.fi/fi/pelisaannot/sananvapaus/",
          },
          {
            value:
              "Mielipiteen –ja sananvapaus: Ihmisoikeudet.net​​",
            navigate: "https://ihmisoikeudet.net/ihmisoikeudet/kansalais-ja-poliittiset-oikeudet/mielipiteen-ja-sananvapaus/",
          },
          {
            value:
              "Sananvapaus: Amnesty International​",
            navigate: "https://www.amnesty.fi/mita-amnesty-tekee/sananvapaus/",
          },
        ]}
      />
    </div>
  );
};
